/*Table structure for table `product` */

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `product_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL,
  `slug` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `product_type` int(4) NOT NULL,
  `product_cate` int(11) NOT NULL,
  `city` int(4) NOT NULL,
  `district` int(11) NOT NULL,
  `ward` int(11) DEFAULT NULL,
  `street` int(11) DEFAULT NULL,
  `lng` varchar(20) DEFAULT NULL,
  `lat` varchar(20) DEFAULT NULL,
  `project_id` int(11) DEFAULT NULL,
  `area` float DEFAULT NULL,
  `price` int(11) DEFAULT NULL,
  `price_type` int(4) DEFAULT NULL,
  `address` varchar(255) NOT NULL,
  `facade` float DEFAULT NULL,
  `entry_width` float DEFAULT NULL,
  `direction` int(4) DEFAULT NULL,
  `balcony_direction` int(4) DEFAULT NULL,
  `floor_number` int(4) DEFAULT NULL,
  `room_number` int(4) DEFAULT NULL,
  `toilet_number` int(4) DEFAULT NULL,
  `interior` text,
  `ct_name` varchar(50) DEFAULT NULL,
  `ct_address` varchar(255) DEFAULT NULL,
  `ct_phone` int(12) DEFAULT NULL,
  `ct_mobile` int(12) NOT NULL,
  `ct_email` varchar(255) DEFAULT NULL,
  `approved` tinyint(2) NOT NULL DEFAULT '0' COMMENT '0:unaproved, 1:approved',
  `author_id` int(11) DEFAULT NULL,
  `start_date` int(11) NOT NULL,
  `end_date` int(11) NOT NULL,
  `published` tinyint(1) NOT NULL DEFAULT '0',
  `deleted` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` int(11) NOT NULL,
  `updated_at` int(11) NOT NULL,
  PRIMARY KEY (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8;

