insert  into `product`(`product_id`,`title`,`slug`,`description`,`product_type`,`product_cate`,`city`,`district`,`ward`,`street`,`lng`,`lat`,`project_id`,`area`,`price`,`price_type`,`address`,`facade`,`entry_width`,`direction`,`balcony_direction`,`floor_number`,`room_number`,`toilet_number`,`interior`,`ct_name`,`ct_address`,`ct_phone`,`ct_mobile`,`ct_email`,`approved`,`author_id`,`start_date`,`end_date`,`published`,`deleted`,`created_at`,`updated_at`) values (1,'Cần bán gấp CH Intracom Trung Văn căn 06 tầng 9, dt 75.8m2, ban công ĐN, giá 20tr/m2 (bao phí)','can-ban-gap-ch-intracom-trung-van-can-06-tang-9-dt-758m2-ban-cong-n-gia-20trm2-bao-phi','Gia đình tôi có căn hộ ở chung cư Intracom muốn bán gấp để lây tiền mua nhà diện tích lớn hơn. Căn 06 tầng 9. Diện tích 75.8m2. 2PN, 2VS. Ban công ĐN. Thoáng mát. Nội thất cơ bản. Tôi đang rất thiện chí bán ai có nhu cầu tôi thương lượng nhiệt tình. Gặp trực tiếp chủ nhà. ĐT 0936453638',1,1,2,2,59,70,'105.82277581831056','21.031824973975713',1051,100,20,5,'2 Dự án Chung cư cao cấp 15 – 17 Ngọc Khánh, Ba Đình, Hà Nội',20,20,2,2,4,5,5,'','','',NULL,1686003570,'',1,NULL,1430413200,1433005200,0,0,1430651170,1431747443),(2,'HOT - CĂN HỘ TIÊU CHUẨN HÀN QUỐC, NGAY Q.2 CHO THUÊ ĐẦY ĐỦ TIỆN NGHI','hot-can-ho-tieu-chuan-han-quoc-ngay-q2-cho-thue-ay-u-tien-nghi','Diện tích 59m2, 79m2, 96m2, 104m2, 110m2 1 phòng ngủ, 2 phòng ngủ và 3 phòng ngủ.\r\nGiá thuê từ 7.57 triệu/tháng.\r\nDự án có xe đưa đón khách hàng hằng ngày đi Quận 1 (Diamond), Quận 2 (Parkson, Metro, Cantavil), Phú Mỹ Hưng Quận 7.\r\nDự án đã có nhà sẵn và đang được các chuyên gia Samsung, Nhật Bản và khách Châu Âu thuê ở đây, môi trường văn minh cao cấp với hồ bơi, sân tennis, nhà hàng Hàn Quốc, sân tập golf, coffe shop, nhà giữ trẻ tiêu chuẩn Hàn Quốc.\r\nLiên hệ: Phòng kinh doanh 0906 18 68 78.',2,4,1,54,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Quận 2, Hồ Chí Minh',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','Dự án Intracom1, Nam Từ Liêm, Hà Nôi',1686003570,1686003570,'',0,NULL,1430848500,1432922100,0,0,1430848564,1430848564),(3,'CHUNG CƯ CHẤT LƯỢNG CAO PARK VIEW RESIDENCE MỞ BÁN LỚN: ĐĂNG KÍ NGAY ĐỂ NHẬN ƯU ĐÃI','chung-cu-chat-luong-cao-park-view-residence-mo-ban-lon-ang-ki-ngay-e-nhan-uu-ai','Mời khách hàng đăng ký tham dự mở bán chung cư Park View Residence. LH Mr Hùng - 090.6789.666\r\n\r\nChủ nhật ngày 17/05/2015, CĐT Cen Invest tổ chức lễ mở bán lớn chung cư chất lượng cao Park View Residence Dương Nội tại phòng GrandBall, khách sạn Daewoo 360 Kim Mã.\r\n+ Bốc thăm trao tặng KH tham dự 5 phần quà có giá trị (1 TV Sony 40”, 2 tủ lạnh Sanyo, 2 quạt phun sương Kangaroo).\r\n+ Gặp gỡ, trả lời câu hỏi giữa đại diện CĐT, đơn vị phân phối, ngân hàng và Khách hàng.\r\n+ Tặng riêng những khách hàng đăng kí mua CH 1-2 điều hòa LG.\r\n+ Ra thêm sàn mới với nhiều căn vị trí đẹp.\r\n\r\n*** Chung cư Parkview Residence được biết đến như 1 cơ hội đầu tư chắc chắn sinh lời, một điểm nóng thu hút sự chú ý của các tổ chức và cá nhân bởi CHẤT LƯỢNG CÔNG TRÌNH VÀ HẠ TẦNG ĐỀU RẤT TỐT SO VỚI GIÁ THÀNH. Hiện nay dự án đang là điểm nóng BĐS khu vực Tây Nam Hà Nội với tốc độ bán hàng tăng cao nhất trong tháng 5 này!\r\n\r\n*** Dự án gồm 3 tòa nhà cao 25 tầng với tầng 1 dành làm TTTM và khu tiện ích cộng đồng. Các căn hộ có thiết kế hiện đại, TỐI ƯU HÓA DIỆN TÍCH SỬ DỤNG (hơn rất nhiều so với các tòa đã đi vào hoạt động trong KĐT, ví dụ như CH nhỏ nhất 57m2 cũng có 2 WC) với nhiều căn diện tích nhỏ. Đây là nơi lý tưởng cho cả người mua ở và giới đầu tư.\r\n\r\n*** Vị trí: Nằm gần bùng binh giao giữa đường Lê Trọng Tấn kéo dài và đường Tố Hữu (hay Lê Văn Lương kéo dài). Tiểu khu Parkview Residence cách khu chợ mới Dương Nội khoảng 5 phút, cách bến xe bus nhanh chỉ 3 phút đi bộ, cách ga tàu điện trên cao chỉ 1Km,...\r\n\r\n*** Dự án có nhiều ưu điểm vượt trội:\r\n- Có quần thể cư dân đã vào sống ổn định với hạ tầng đầy đủ.\r\n- Có khu vui chơi và quảng trường rộng rãi (điều mà ít KĐT nội thành có được).\r\n- TRANG BỊ BỂ BƠI RIÊNG, Tuyến Bus nhanh (Kim Mã- Yên Nghĩa) dành riêng cho cư dân - tiểu khu.\r\n- Nội thất được bàn giao đầy đủ và CAO CẤP hơn nhiều so với các tòa khác.\r\n- Đội ngũ quản lí cao cấp- PMC (đơn vị từng quản lí nhiều CCCC như Mullberry Lane, Văn Phú Victoria,... ); Sảnh chờ sang trọng, quản lí nghiêm ngặt bằng thẻ từ thông minh,... =) Khách hàng sẽ tận hưởng cuộc sống tiện nghi, cao cấp như cư dân nhiều tòa CCCC nội thành Hà Nội.\r\n\r\n*** Hiện đang còn một số căn góc dự án với GIÁ GỐC trực tiếp từ chủ đầu tư từ: 1,1 tỷ/ CH.\r\nCác loại diện tích phù hợp với nhiều loại đối tượng khách hàng: 57,5-72-80-85-111m2.\r\nMới ra các tầng đẹp 8, 10, 12, 15, 17, 18. Một số tầng tòa H.\r\nLH Phòng kinh doanh để nhận được bảng hàng cập nhật nhất (Hotline: 090.6789.666).\r\n\r\n*** ƯU ĐÃI ĐẶC BIỆT khi khách hàng đăng kí mua CH trước 17/05:\r\n+ KH nhận ngay 1 lượng vàng (khấu trừ tương ứng vào GTHĐ là 35 triệu) khi là 1/100 KH đầu tiên đăng kí mua CH (hiện chỉ còn hơn 30 suất).\r\n+ KH hàng nhận ngay mức lãi suất 0% và ân hạn nợ gốc trong vòng 13-16 tháng (tính theo thời điểm bàn giao CH).\r\n+ KH hàng nhận ngay mức ưu đãi chiết khấu 4% GTCH trừ thẳng vào GTHĐ khi khách hàng đóng 100% giá trị Hợp đồng.\r\n\r\n“Cơ hội vàng chỉ dành cho những ai có tầm nhìn”.\r\nGọi ngay Mr Hùng- 090.6789.666.\r\nPhòng kinh doanh- Sàn Giao dịch Bất động sản STDA.\r\nĐịa chỉ: 137 Nguyễn Ngọc Vũ- Trung Hòa- Cầu Giấy- Hà Nội.',1,1,2,15,NULL,NULL,'105.75636580000003','20.955835',NULL,57,1,3,'Ha Dong, Ha Noi',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','',NULL,2147483647,'',0,NULL,1431622800,1443546000,0,0,1431673582,1431673582),(4,'BÁN CHUNG CƯ THỦ THIÊM SKY VỊ TRÍ NGAY PHƯỜNG THẢO ĐIỀN, Q. 2','ban-chung-cu-thu-thiem-sky-vi-tri-ngay-phuong-thao-ien-q-2','Bán chung cư Thủ Thiêm Sky vị trí ngay phường Thảo Điền, Q. 2, vị trí ba mặt tiền sông Sài Gòn, hai phòng ngũ lầu cao giá 22tr/m2 đã có VAT, phí bảo trì bao gồm nội thất, thanh toán nhiều đợt, liên hệ A.Duy 0913 045 277 ',1,1,1,54,NULL,NULL,'106.74981049999997','10.7872729',NULL,NULL,2