hủ Đức: 2km.\r\n- Kề siêu thị điện máy 30/4.\r\n- Cách phòng khám đa khoa Á Châu: 2km.\r\n- Cách ngân hàng Sài Gòn, Á Châu, VPbank, Đông Á trong bán kính khoảng 3km.\r\n- Cách ĐH Ngân Hàng, ĐH Luật, CĐ Công Nghệ Thủ Đức, ĐH Ngoại Thương, ĐH Sư Phạm Kỹ Thuật trong bán kính 4km.\r\n\r\nƯu điểm.\r\n- Dự án được quy hoạch đồng bộ, các tuyến đường xuyên tâm có lộ giới 30m. Hệ thống điện, nước, viễn thông được ngầm hóa. Cảnh quan kiến trúc được chú trọng và phát triển hài hòa tạo môi trường sống lý tưởng.\r\n- Công viên cây xanh và an ninh yên tĩnh.\r\n- Dễ dàng di chuyển Q. 1, Q. 2, Q. 9, Bình Thạnh, Gò Vấp….\r\n- Tự do kiểu cách xây dựng và không quy định thời gian xây dựng, thuận tiện ở, kinh doanh, buôn bán,...\r\n\r\nĐặc biệt hơn:\r\n- Thổ cư 100%, giấy chứng nhận quyền sử dụng đất riêng biệt từng nền.\r\n- Miễn phí GPXD và bản vẽ, giao nền xây dựng ngay.\r\n- Pháp lý cam kết rõ ràng và minh bạch:\r\nCam kết các đợt thanh toán đều tại phòng công chứng.\r\nCam kết 100% sổ đỏ thổ cư riêng từng nền.\r\nCam kết hạ tầng hoàn chỉnh: Điện, nước tới tận từng nền.\r\nCam kết thời gian nhận sổ chỉ 45-90 ngày.\r\n\r\nChương trình khuyến mãi: Tháng 05/2015.\r\n- Chiết khấu trực tiếp 1% trên tổng giá trị lô đất.\r\n- Chương trình bốc thăm và khuyến mãi tặng trực tiếp 1 chỉ SJC/nền (Tổng giải thưởng 3 tỷ).\r\n- Mở bán đợt 01 với mức giá ưu đãi cho 05 khách hàng đầu tiên chỉ 355 triệu/nền (ngân hàng BIDV cam kết cho vay 50%-80%, LS: 7.2%/năm). Phương thức thanh toán linh hoạt thành 05 đợt.\r\n\r\n- Diện tích: Từ 50 đến 300m2. Đa dạng nhiều loại diện tích và chính hướng Đông Tây Nam Bắc.\r\nHotline: PKD chủ đầu tư 0937.747.361-090.180.79.44.\r\nHãy nhanh tay nhấc máy để được tư vấn rõ hơn về thông tin cũng như vị trí lô đất.',1,6,1,71,NULL,2773,'106.75512630000003','10.8545551',NULL,70,NULL,NULL,'22, Thu Duc, Ho Chi Minh',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','',NULL,1686003570,'',0,NULL,1431622800,1444323600,0,0,1431678494,1431678494),(20,'BÁN TRANG TRẠI XÃ THANH HƯNG, HUYỆN ĐIỆ