u-biet-thu-bien-vinpearl-phu-quoc','Vingroup mở bán sản phẩm đầu tư Vinpearl Premium cam kết sinh lời 1,6 tỷ - 2 tỷ/năm/10 năm liền cho khách hàng.\r\n\r\nNhiều lô biệt thự tại Vinpearl Phú Quốc, các loại diện tích 400m2 – 700m2, thiết kế 2-4 phòng ngủ, sân vườn bể bơi cùng nhiều hạ tầng đồng bộ, view biển hoặc sân golf(theo chiều cao của đồi, tựa núi, view biển tuyệt đẹp). \r\n\r\nChủ đầu tư cam kết chia sẻ lợi nhuận đặc biệt hấp dẫn, tối đa 85% từ lợi nhuận của hoạt động cho thuê nhưng không thấp hơn 8%/tổng giá trị của căn biệt thự/năm/10 năm/ USD.\r\nKhách hàng đóng tiền theo tiến độ hoặc đóng luôn 100% để nhận luôn lãi suất.\r\n\r\nHiện khu nghỉ dưỡng đã đi vào hoạt động, khai thác cho thuê với hiệu suất đến 95%.\r\n\r\nLiên hệ phụ trách dự án:\r\n\r\nMr. Thái Dương - 0906 942 379',1,3,34,360,NULL,NULL,'103.96519899999998','10.22644',NULL,400,14,3,'Phu Quoc, Kien Giang',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','',NULL,1666623186,'',0,NULL,1431622800,1438966800,0,0,1431679996,1431679996),(28,'CẦN BÁN CĂN LIỀN KỀ DUYÊN THÁI (THƯỜNG TÍN) GIÁ HỢP LÝ - QUÀ TẶNG HẤP DẪN','can-ban-can-lien-ke-duyen-thai-thuong-tin-gia-hop-ly-qua-tang-hap-dan','Chúng tôi đang phân phối căn liền kề trong khu nhà ở và thương mại Duyên Thái, Thường Tín với giá gốc:\r\n- Diện tích các căn liền kề lần lượt: 63,8m2, 65m2, 75m2, 80m2, 85m2, 102m2.\r\n- Mặt tiền đều rộng: 5m.\r\n- Đường rộng từ: 6m đến 10m.\r\n- Giá xây dựng phần thô: 3,3 triệu/m2 (thiết kế xây 3 tầng).\r\nCăn hộ với chất lượng công trình cực tốt, địa thế đẹp, thoáng mát và yên tĩnh.\r\nLiên hệ ngay để biết chi tiết:\r\nBan quản lý dự án 0983.289.636\r\nCông ty cổ phần tư vấn đầu tư bất động sản THT LAND.\r\nĐịa chỉ: Phòng 1908-tòa nhà 34T-Hoàng Đạo Thúy-Phường Trung Hòa-Quận Cầu Giấy-Hà Nội.\r\n\r\nDự án khu nhà ở và văn phòng Duyên Thái do công ty TNHH HacomLand Duyên Thái làm chủ đầu tư là đơn vị thành viên của Công Ty cổ phần xuất nhập khẩu và xây dựng Hà Nội (hacomec).\r\nDự án khu nhà ở và thương mại Duyên Thái có quy mô 1,4 ha được xây dựng tại xã Duyên Thái, huyện Thường Tín, TP Hà Nội.\r\n\r\nChi tiết dự án.\r\nThành Phố: Hà Nội.\r\nQuận huyện: Thường tín.\r\nPhường xã: Duyên Thái.\r\nĐịa chỉ: Cụm 9, xã Duyên Thái, huyện Thường Tín, TP Hà Nội.\r\nQuy mô: 1,4 ha.\r\nTổng mức đầu tư: 250 tỷ.\r\nChủ đầu tư: Công ty TNHH HacomLand Duyên Thái.\r\n\r\nVị trí dự án:\r\nKhu nhà ở và thương mại Duyên Thái tọa lạc trên vị trí đặc địa, cửa ngõ phía nam của thủ đô Hà Nội. Tại xã Duyên Thái, Huyện Thường Tín, TP Hà Nội.\r\n- Phía tây cách đường QL 1A cũ 100m.\r\n- Phía đông giáp đường QL 1B(cao tốc pháp vân cầu giẽ 500m).\r\n- Phía Nam cách thị trấn huyện Thường Tín 3km về.\r\n- Phía bắc giáp dự án bến xe khách liên tỉnh xã Liên Ninh, huyện Thanh Trì, TP Hà Nội. Cách Ga Giáp Bát 9km.\r\nBan quản lý dự án 0983.289.636\r\nCông ty cổ phần tư vấn đầu tư bất động sản THT LAND.\r\nĐịa chỉ: Phòng 1908-tòa nhà 34T-Hoàng Đạo Thúy-Phường Trung Hòa-Quận Cầu Giấy-Hà Nội.\r\nChi tiết dự án: http://bdsthtland.vn/default.aspx? v=du-an-khu-nha-o-va-thuong-mai-duyen-thai&e=dtbds&idbds=29034',1,3,2,26,11342,NULL,'105.86719540000001','20.8986756',NULL,75,NULL,NULL,'Ward Duyen Thai, Thuong Tin, Ha Noi',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','',NULL,1686003570,'',0,NULL,1431622800,1447952400,0,0,1431680176,1431680176),(29,'BÁN NHÀ PHỐ MEGA VILLAGE, Q9 – SỔ HỒNG TRAO TAY – GIÁ TỪ 2.4 TỶ','ban-nha-pho-mega-village-q9-so-hong-trao-tay-gia-tu-24-ty','Bán nhà phố liền kề có sân vườn Mega Village – P. Phú Hữu, Q. 9. Tọa lạc ngay giao lộ Cao tốc Long Thành – Dầu Giây và đường Vành Đai Trong (60m), tiếp giáp với các dự án cao cấp như: Villa Park, Goldora Villa (IndochinaLand), Riviera Cove (KeppelLand).\r\nDự án Mega Village là dự án nhà ở do Công ty Khang Điền làm CĐT.\r\nDự án nằm ngay đầu mối giao thông quan trọng nối trung tâm với các vùng lân cận.\r\nMega Village được xây dựng hoàn chỉnh, đồng bộ, khu Compound như Phú Mỹ Hưng, Quận 7.\r\nTiện ích nội khu: Hồ bơi, CV cây xanh cạnh bờ sông, siêu thị mini, ….\r\nThông tin chi tiết dự án: Tổng diện tích: 57.048m2 với tổng số nhà phố và biệt thự là 300 căn.\r\nBảo vệ và an ninh 24/24.\r\nDiện tích từ: 5mx15m, 5mx18m.\r\nNhà xây 01 trệt, 02 lầu (Giao nhà thô).\r\nGiá bán cạnh tranh chỉ từ 2,4 tỷ/căn (Chưa bao gồm VAT) cho cả nhà và đất.\r\nGiao sổ hồng từng căn sau 06 tháng nhận nhà.\r\nLiên hệ Phòng KD: 0904.652.729 (Để chọn vị trí đẹp nhất và xem nhà mẫu thực tế).',1,3,1,61,NULL,NULL,'106.82868510000003','10.8428402',NULL,135,3,3,'District 9, Ho Chi Minh',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','',NULL,1686580890,'',0,NULL,1431622800,1441299600,0,0,1431680284,1431680284),(30,'CẦN BÁN GẤP BIỆT THỰ TRONG KĐT TRUNG YÊN, ĐÃ HOÀN THIỆN NỘI THẤT CAO CẤP 150TR/M2 -(090.456.13.14)','can-ban-gap-biet-thu-trong-kt-trung-yen-a-hoan-thien-noi-that-cao-cap-150trm2-0904561314','Gia đình tôi cần bán gấp căn biệt thự trong khu đô thị Trung Yên, Cầu Giấy, Hà Nội. Diện tích 178m2, xây 4 tầng và 1 hầm,Nội Thất Gỗ cao cấp.Nhà nằm ở vị trí lô góc thoáng mát, hướng cửa chính Tây Bắc.\r\nCăn biệt thự nằm trong khu đô thị Trung Yên với hạ tầng đồng bộ và ổn định, dân trí cao tiện ở hoặc làm văn phòng. Nhà đã hoàn thiện nội thất cao cấp chỉ việc dọn về ở luôn, Nhà có sổ đỏ chính chủ\r\n\r\nGiá bán 150tr/m2 có thương lượng\r\n\r\nLH: 090.456.13.14 - 0977.434.515 gặp Mr. Việt.',1,3,2,7,NULL,NULL,'105.79058250000003','21.0362368',NULL,178,150,2,'Cau Giay, Ha Noi',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','',NULL,1695416267,'',0,NULL,1431622800,1438880400,0,0,1431680385,1431680385);

/*Table structure for table `product_attachment` */

DROP TABLE IF EXISTS `product_attachment`;

CREATE TABLE `product_attachment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` bigint(11) NOT NULL,
  `path` varchar(255) NOT NULL,
  `base_url` varchar(255) DEFAULT NULL,
  `type` varchar(255) DEFAULT NULL,
  `size` int(11) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `created_at` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_product_attachment_product` (`product_id`),
  CONSTRAINT `fk_product_attachment_product` FOREIGN KEY (`product_id`) REFERENCES `product` (`product_id`) ON DELETE CASCADE ON UPDATE CASCADE
