/*Table structure for table `product_en` */

DROP TABLE IF EXISTS `product_en`;

CREATE TABLE `product_en` (
  `product_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL,
  `slug` varchar(255) NOT NULL,
